#!/usr/bin/env python3
mySet = set('ATGTGGG')
mySet2 = {'ATGTGGG'}
print(mySet)
print(mySet2)

set1 = {3, 15, 15, 9, 26, 5, 35, 9}
set2 = {60, 22, 14, 0, 9}
print(set1)
print(set2)

#difference of set1 and set2
difference1 = set1 - set2
difference2 = set2 - set1
print(difference1)
print(difference2)

#union of set1 and set2
union1 = set1 | set2
print(union1)

#intersection of set1 and set2
intersection1 = set1 & set2
print(intersection1)

#symmetric difference of set1 and set2
symm_diff = set1 ^ set2
print(symm_diff)

#create a set with set function of DNA seq
dna_set = set('')
print(dna_set)
